import React from 'react';

import styles from './Main.module.css';
import Aux from '../../hoc/Auxillary/Auxillary';
import MainItem from './MainItem/MainItem';

const Main = (props) => (
  <Aux>
    <ul className={styles.Main}>
      <li>
        <MainItem />
      </li>
      <li>project 2</li>
      <li>project 3</li>
      <li>project 4</li>
    </ul>
    <div>Line Across</div>
  </Aux>
);

export default Main;
